const Error = (props) => {
  return (
    <section className="error">
      <header></header>
      <main>
        <p className="error__title">404</p>
        <p className="error__subtitle">Страница не найдена</p>
        <p className="error__exit">Назад</p>
      </main>
      <footer></footer>
    </section>
  );
};

export default Error;
